import React from 'react'
import all_product from '../components/assets/all_product'
import { useParams } from 'react-router-dom'

export const Product = () => {
  const {ProductId} = useParams();
  return (
    <div>
    const product = {all_product.find((e)=>{
      e.id == ProductId      
    })}
    </div>
  )
}
